df = pd.merge(df, df_summary, how='left', on=['company_hash', 'job_position', 'Years_of_Experience'])

# Step 4: Create 'Designation_Flag' based on whether CTC is higher than the average for similar job positions and years of experience
df['Designation_Flag'] = np.where(df['ctc'] > df['ctc_mean'], 1, 2)

# Step 5: Creating 'Class_Flag' based on company and job position performance
df['Class_Flag'] = np.where(df['ctc'] > df['ctc_median'], 1, 3)  # 1 for above median, 3 for below median

