df['Tier_Flag'] = pd.qcut(df['ctc'], q=3, labels=[3, 2, 1])  # 1 for top tier, 2 for middle, 3 for bottom tier

# Step 7: Display the updated DataFrame with the flags
print(df[['company_hash', 'job_position', 'Years_of_Experience', 'ctc', 'Designation_Flag', 'Class_Flag', 'Tier_Flag']].head())

