# Step 2: Determine tiers based on average CTC
def assign_tier(avg_ctc):
    if avg_ctc >= 80000:  # Tier 1
        return 1
    elif 60000 <= avg_ctc < 80000:  # Tier 2
        return 2
    else:  # Tier 3
        return 3

average_ctc['tier'] = average_ctc['avg_ctc'].apply(assign_tier)  # Assign tiers using the average CTC

# Print tiers to verify they were assigned correctly
print("\nAverage CTC with Tiers:")
print(average_ctc)

# Step 3: Merge the tier information back into the original DataFrame
df = pd.merge(df, average_ctc[['company_hash', 'avg_ctc', 'tier']], on='company_hash', how='left')

# Print the merged DataFrame to check if 'avg_ctc' was included
