import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
from sklearn.preprocessing import StandardScaler
from sklearn.cluster import KMeans
from sklearn.metrics import silhouette_score

# Sample DataFrame setup (assuming df is your DataFrame)
# Uncomment the next lines if you need to create a sample DataFrame for testing
# np.random.seed(42)
# df = pd.DataFrame({
#     'company_hash': np.random.choice(['comp1', 'comp2', 'comp3', 'comp4'], 800),
#     'job_position': np.random.choice(['Engineer', 'Manager', 'Senior Engineer', 'Intern'], 800),
#     'ctc': np.random.randint(30000, 120000, 800),
#     'Years_of_Experience': np.random.randint(0, 10, 800)
# })

# Select features for clustering
features_to_scale = ['ctc', 'Years_of_Experience']

# Standardize the features
scaler = StandardScaler()
X_scaled = scaler.fit_transform(df[features_to_scale])

# Determine the optimal number of clusters using the Elbow Method
inertia = []
silhouette_scores = []
K = range(2, 11)  # Range of clusters to try

for k in K:
    kmeans = KMeans(n_clusters=k, random_state=42)
    kmeans.fit(X_scaled)
    inertia.append(kmeans.inertia_)
    silhouette_scores.append(silhouette_score(X_scaled, kmeans.labels_))

# Plotting the Elbow Method
plt.figure(figsize=(12, 6))
plt.subplot(1, 2, 1)
plt.plot(K, inertia, marker='o')
plt.title('Elbow Method for Optimal k')
plt.xlabel('Number of clusters (k)')
plt.ylabel('Inertia')

# Plotting Silhouette Scores
plt.subplot(1, 2, 2)
plt.plot(K, silhouette_scores, marker='o')
plt.title('Silhouette Scores for Optimal k')
plt.xlabel('Number of clusters (k)')
plt.ylabel('Silhouette Score')
plt.show()

# Choose the number of clusters based on the plots (e.g., k = 3)
optimal_k = 3
kmeans = KMeans(n_clusters=optimal_k, random_state=42)
df['Cluster'] = kmeans.fit_predict(X_scaled)

# Display the results
print(df[['company_hash', 'job_position', 'ctc', 'Years_of_Experience', 'Cluster']].head())

